import  org.apache.poi.xssf.usermodel.*

def fis = new FileInputStream ("C:\\Users\\Shobana\\SOAPtestData\\excelTestData1.xlsx")
def wb = new XSSFWorkbook(fis)

def ws = wb.getSheet("sheet1")
def numR = ws.getPhysicalNumberOfRows()

// loop through thr rows
for (def i=0; i < numR; i++) {

	def row = ws.getRow(i)
	// loop through the columns on each row
	def numC = row.getPhysicalNumberOfCells()

	for (def j=0; j < numC; j++) {
		def cell = row.getCell(j)
		log.info cell.getStringCellValue()
	}
}

