import java.sql.DriverManager

//load driver
Class.forName("com.mysql.jdbc.Driver")

//setup connection to a DB test1
def conn = DriverManager.getConnection ("jdbc:mysql://localhost:3306/test1",
            "root",
            "root")


// create a statement object
def stmt = conn.createStatement()

//execute query and get result set
def rs = stmt.executeQuery("SELECT * FROM users")

// go through the result set

while (rs.next()) {

  // fetch data and display
  // log.info  (rs.getString("id") + "    " + rs.getString("name"))

  def  name = rs.getString("name")

  // set a suite level property with value fetched from database
  testRunner.testCase.testSuite.setPropertyValue("CountryName", name)
  testRunner.runTestStepByName("GetCountryRequest1")


}

